  return (
    <div className="flex justify-between items-center">
      <div className="flex items-center gap-2">
        {/* <User className="bg-gray-800 p-2 rounded-full" /> */}
        <h1 className="text-xl font-bold text-green-500">Dhan</h1>
        </div>
